import React from 'react';
import './App.css';

class App extends React.Component {

  constructor(props) {
    super(props)
    this.state = {
      tittle: 'Martin Kuchar',
      headerLinks: [
        {tittle: 'Home', path: '/'},
        {tittle: 'About', path: '/about'},
        {tittle: 'Contact', path: '/contact'}
      ],
      home: {
        tittle: 'Do More',
        subTittle: '',
        text: ''
      }, 
      about: {
        tittle: 'About me',
      },
      contact: {
        tittle: 'Contact me'
      }
    }
  }

  render() {
    return (
      <div>Hello from React</div>
    );
  }
}

export default App;
